prompt --application/shared_components/security/authentications/my_authentication
begin
wwv_flow_api.create_authentication(
 p_id=>wwv_flow_api.id(10663691587111568849)
,p_name=>'My Authentication'
,p_scheme_type=>'NATIVE_CUSTOM'
,p_attribute_03=>'my_auth'
,p_attribute_05=>'N'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'FUNCTION my_auth (',
'    p_username in varchar2, ',
'    p_password in varchar2)',
'RETURN BOOLEAN AS',
'    found number :=0;',
'BEGIN',
'   SELECT 1 INTO found FROM MY_USER',
'   WHERE upper (user_name) = upper (p_username)',
'   AND user_password = p_password',
'   AND user_activated = 1;',
'   RETURN TRUE;',
'EXCEPTION',
'    WHEN NO_DATA_FOUND THEN',
'    RETURN FALSE;',
'END;'))
,p_invalid_session_type=>'LOGIN'
,p_use_secure_cookie_yn=>'N'
,p_ras_mode=>0
);
end;
